script: |
  super -f text -I q385.spq | sort > q385.out

inputs:
  - name: q385.spq
    data: |
      SELECT DISTINCT - ( - COUNT ( * ) ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q385.out
    data: |
      9
